import React,{Component} from 'react';

export class Todo extends Component {

    constructor(props) {
        super(props);
    }   

    render() {
        return ( 
            <div>
                <p>{this.props.text}  ... {this.props.priority} ... {this.props.dueDate}</p>
            </div> 
        );
    }
}
export default Todo;
